<head>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8"/>
    <title>Untitled Document</title>

    <link href="https://fonts.googleapis.com/css2?family=Open+Sans:wght@300&display=swap" rel="stylesheet">
    <link href="https://fonts.googleapis.com/css2?family=Open+Sans:wght@300;600&display=swap" rel="stylesheet">

    <style>
        body {
            padding: 0;
            margin: 0;
        }

        * {
            font-family: 'Open Sans', sans-serif;
        }

        .content {
            width: 600px;
            background: linear-gradient(208.56deg, #1A5E9C 0%, #599EDB 100%);
        }

        .grey-separator {
            height: 1px;
            width: 100%;
            background: #E6E6E6;
            margin: 30px 0;
        }

        .grey-separator-2 {
            height: 1px;
            width: 100%;
            background: #E6E6E6;
            margin: 30px 0 5px 0;
        }

        a {
            font-family: Open Sans;
            font-style: normal;
            font-weight: 600;
            font-size: 13px;
            line-height: 140%;
            text-decoration-line: underline;
            color: #2B5FAE;
            cursor: pointer;
            margin: 10px 20px 20px 0;
        }

        a:hover {
            text-decoration-line: none;
        }

        .wrapper {
            background-color: #ffffff;
            padding: 20px;
        }

        .button {
            width: 165px;
            height: 38px;
            background: #2B5FAE;
            border-radius: 3px;
            margin: 0 auto;
            color: white;
            text-align: center;
            line-height: 38px;
            font-weight: 600;
            cursor: pointer;
            border: none;
        }

        .button:hover {
            -webkit-box-shadow: 0 5px 10px rgba(43, 95, 174, 0.3);
            box-shadow: 0 5px 10px rgba(43, 95, 174, 0.3)
        }

        .footer {
            display: flex;
            justify-content: space-between;
        }

        .footer p, .footer a {
            font-family: Open Sans;
            font-style: normal;
            font-weight: 600;
            font-size: 11px;
            line-height: 140%;
            color: #919BA2;
        }
    </style>
</head>
